import { createSelector } from 'reselect';

const selectHiDomain = () => (state) => state.get('Hi');
console.log(selectHiDomain);
const selectHi = () => createSelector(
  selectHiDomain(),
  (state) => {
    console.log(state.get('hi'));
    return state.get('hi');
  }
)

export {
  selectHi,
}
